import { useEffect, useState } from "react";
import axios from "axios";

const Moon = () => {
  const [moonData, setMoonData] = useState(null);
  const [date, setDate] = useState(new Date().toISOString().split("T")[0]); // Get today's date in YYYY-MM-DD format

  useEffect(() => {
    axios
      .get(`https://api.viewbits.com/v1/moonphase?startdate=${date}`)
      .then((response) => {
        setMoonData(response.data);
      })
      .catch((error) => console.error("Error fetching data:", error));
  }, [date]); // Re-fetch data when date changes

  return (
    <div>
      <h2>Moon Phase</h2>
      <input
        type="date"
        value={date}
        onChange={(e) => setDate(e.target.value)}
      />
      {moonData ? (
        <p>Moon Phase: {moonData.moonPhase}</p>
      ) : (
        <p>Loading moon data...</p>
      )}
    </div>
  );
};

export default Moon;
